  true,\n\t\"url\": null,\n\t\"notes\": \"This database contains the rotational spectral
  lines observed and reported in the open literature for 91 hydrocarbon molecules
  through September 1987. The isotopic molecular species, assigned quantum numbers,
  observed frequency, estimated measurement uncertainty and reference are given for
  each transition reported. In addition to correcting a number of misprints and errors
  in the literature cited, the spectral lines for many normal isotopic species have
  been refit to produce a comprehensive and consistent analysis of all the data extracted
  from various literature sources. The derived molecular properties, such as rotational
  and centrifugal distortion constants, hyperfine structure constants, electric dipole
  moments, and rotational g-factors are listed.\",\n\t\"license_title\": \"Other License
